import { Component } from '@angular/core';
import { headerList } from 'src/app/interfaces/interfaces';

@Component({
  selector: 'app-organizational-account',
  templateUrl: './organizational-account.component.html',
  styleUrls: ['./organizational-account.component.scss']
})
export class OrganizationalAccountComponent {

  data:headerList[]=[
    {
      id : 1,
      isSelected : true,
      label : 'Joined'
    },
    {
      id : 2,
      isSelected : false,
      label : 'Suggestions'
    }

  ];
selectedid:number = 1;
  getSelectedOne(item:headerList){
    console.log(item.label);
    this.selectedid = item.id;
  }

joinedList = [
  {id: 1, name: 'Anusha'},
  {id: 2, name: 'madhuri'}
];

suggestionList = [
  {id: 3, name: 'sindhu'},
  {id: 4, name: 'priya'}
]

deleteClicked(id:number){
  this.suggestionList.push()
  this.joinedList.splice(id,1);
}

}
